c9 \ucee4\uc11c \uc81c\ub300\ub85c \ube0c\ub9ac \uc624\ub9cc \uad6c\ub9e4", "\ub450\ubc88\uc9f8 \uad6c\ub9e4 \uc88b\ub2e4 \uc77c\uc5b4\ub098\ub2e4 \uac70\ub72c\ud558\ub2e4 \uae30\ubd84 \uc88b\ub2e4 \uc74d\ub2c8 \ube60\ub974\ub2e4 \ubc30\uc1a1 \uac10\uc0ac\ud558\ub2e4", "\uc8fc\ubb34\uc2dc\ub2e4 \ucd94\ucc9c \uc548\uc815 \uc131\ubd84 \uc7a0\uc790\ub2e4 \uac00\ub8e8 \ud615\ud0dc \ucd95\ucd95\ud558\ub2e4 \ubcf4\uad00 \uc2e0\uacbd \uc4f8\ub2e4 \uc0c1\uc138", "\ubd80\ubaa8\ub2d8 \uc120\ubb3c \ub4dc\ub9ac\ub2e4 \ud310\ub9e4 \ubbff\ub2e4 \uad6c\ub9e4 \ud3b8\uc9c0 \ub123\ub2e4 \uc88b\ub2e4 \uc81c\ud488 \uc591\uc2ec \ud310\ub9e4 \ubd80\ubaa8\ub2d8 \ud56d\uc0c1 \uac74\uac15\ud558\ub2e4 \uc88b\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ud608\uc555 \uce58\uac00 \ub192\ub2e4 \ud06c\ub2e4 \uad6c\uc785 \ubcf5\uc6a9 \ud574\ubcf4\ub2e4 \uc99d\uc0c1 \ud06c\uae30 \ubd80\ub2f4 \uc2f6\ub2e4 \uc801\ub2f9\ud558\ub2e4 \ud06c\uae30 \ub118\uae40 \uc27d\ub2e4 \uaf2c\ubc15\uaf2c\ubc15 \uac74\uac15 \ubc14\ub77c\ub2e4 \uc0c1\ud0dc \ub77c\uba74 \uc7ac\ub2e4 \ub9e4\uac01", "\ubc30\uc1a1 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uac31\ub144\uae30 \uc99d\uc0c1 \uc2ec\ud558\ub2e4 \uc8fc\ubb38 \uad1c\ucc2e\ub2e4 \uc88b\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ubcf4\uc9c0 \ubbff\ub2e4 \uc88b\ub2e4 \uc7ac\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uc0dd\ub9ac\ud1b5 \uc2ec\ud558\ub2e4 \uac74\uae30 \ube0c\ub9ac \uc81c\ud488 \ud6c4\uae30 \uc88b\ub2e4 \uad6c\ub9e4 \uafb8\uc900\ud558\ub2e4 \uc88b\ub2e4 \ud734\ub300 \ubbf8\ub2c8 \ube14\ub9ac\uc2a4 \ub044\ub2e4 \ub123\ub2e4 \uc0c1\uc138", "\ubd88\uba74\uc99d \uc2ec\ud558\ub2e4 \uc218\uba74\uc81c \ubcf5\uc6a9 \ub04a\ub2e4 \uc8fc\ubb38 \uc218\uba74 \ub298\uc5b4\ub098\ub2e4 \uc7a0\ub4e4\ub2e4 \ub3c4\uc6c0 \uc218\uc800 \uacc4\ub7c9 \uc2a4\ud47c \uc0ac\ub2e4 \uc2a4\ud47c \uc544\uc26c\uc6c0 \ub2eb\ub2e4", "\uac00\uaca9 \uc2f8\ub2e4 \uc0ac\ub2e4 \ubc30\uc1a1 \ube68\ub974\ub2e4 \ud14c\ub808\ube44 \uc88b\ub2e4 \ub4dc\ub9ac\ub2e4 \uc5ec\uc131 \uc778\uae30 \ub9ce\ub2e4 \uc81c\ud488 \uc5b4\ub5bb\ub2e4 \uae30\ub300 \uac74\uac15\ud558\ub2e4 \ucd5c\uace0 \uc88b\ub2e4 \uac10\uc0ac\ud558\ub2e4", "\uac00\uaca9 \uad1c\ucc2e\ub2e4 \ubc30\uc1a1 \uc88b\ub2e4", "\uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ud3ec\uc7a5 \uc0c1\ud0dc \ud3ec\uc7a5 \uae54\ub054\ud558\ub2e4 \uc88b\ub2e4", "\uac00\uaca9 \uad1c\ucc2e\ub2e4 \ubc30\uc1a1", "\uc88b\ub2e4 \uc88b\ub2e4", "\uac00\uaca9 \uc2f8\ub2e4 \uc0ac\ub2e4 \ubc30\uc1a1 \ube68\ub974\ub2e4 \uc88b\ub2e4", "\ubc30\uc1a1", "\uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ud3ec\uc7a5 \uc0c1\ud0dc \ud3ec\uc7a5 \uae54\ub054\ud558\ub2e4 \uc88b\ub2e4 \uafb8\uc900\ud558\ub2e4 \ubcf5\uc6a9 \ud608\uc555 \uc548\uc815", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uac74\uac15\uac80\uc9c4 \ucf5c\ub808\uc2a4\ud14c\ub864 \uc218\uce58 \uace0\uc9c0\ud608\uc99d \ub192\ub2e4 \uae5c\ub180 \uc54c\uc544\ubcf4\ub2e4 \ud6c4\uae30 \uc88b\ub2e4 \uad6c\ub9e4 \uaca8\uc6b8 \uc190\ubc1c \ucc28\ub2e4 \ub450\ub8e8 \ub450\ub8e8 \uc88b\ub2e4 \uae30\ub300\ud558\ub2e4 \ud6c4\uae30 \uc62c\ub9ac\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ub3d9\ubb3c\uc131 \uc624\uba54\uac00 \uc911\uae08\uc18d \ud574\uc870\ub958 \uc624\uba54\uac00 \uad6c\ub9e4 \uc5ed\uc2dc \uc2dd\ubb3c\uc131 \uadf8\ub807\ub2e4 \ube44\ub9ac\ub2e4 \uba39\uae30 \uc88b\ub2e4 \ud608\uc561 \uc21c\ud658 \uace0\uc9c0\ud608\uc99d \ucf5c\ub808\uc2a4\ud14c\ub864 \uc218\uce58 \uc88b\uc544\uc9c0\ub2e4 \uc2e0\uae30\ud558\ub2e4 \uafb8\uc900\ud558\ub2e4 \ud608\uc555 \ub192\ub2e4 \ubd84\ud558\ub2e4 \uc88b\ub2e4 \ub2eb\ub2e4 \uc0c1\uc138 \uc0c1\uc138 \uc0c1\uc138", "\uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uc720\ud1b5 \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uc0bc\ud0a4\ub2e4 \ubd80\ub2f4 \uc0ac\uc774\uc988 \uc7a5\uae30\uac04 \uc54c\ub2e4 \uc2e0\uc785\uc0ac\uc6d0 \ud3b8\uc9c0 \uc88b\ub2e4 \ubbf8\ub9ac \ub290\ub07c\ub2e4 \uc0c1\uc138", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ud608\uc804 \uc548\uc2ec \ub3fc\ub2e4 \ucf54\ub85c\ub098 \ubc31\uc2e0 \ubd80\uc791\uc6a9 \ud608\uc804 \ub365\ub2e4 \ud608\uc804 \uc0dd\uae30 \ud608\uad00 \uc881\ub2e4 \uc2ec\ud558\ub2e4 \ud608\uad00 \uc544\uc608 \ub9c9\ub2e4 \ubc84\ub9ac\ub2e4 \ud608\uc561 \ud750\ub984 \uba48\ucd94\ub2e4 \ub300\uc694 \uc911\uc131 \uc9c0\ubc29 \uc218\uce58 \ub192\ub2e4 \ucf5c\ub808\uc2a4\ud14c\ub864 \uc218\uce58 \ub192\ub2e4 \ud608\uc804 \uc0dd\uae30\ub2e4 \uc26c\ub2e4 \uc704\ud5d8\ud558\ub2e4 \uc2b5\uad00 \uc778\uc9c0 \uac00\uc871 \ucf5c\ub808\uc2a4\ud14c\ub864 \ub192\ub2e4 \uc2dd\ub2e8 \uc870\uc808 \ubc31\uc2e0 \ubd80\uc791\uc6a9 \ud608\uc804 \ud558\ub2c8 \ubd88\uc548\ud558\ub2e4 \ucee4\uc9c0\ub2e4 \uac00\uc871 4\ubd84 \ubc31\uc2e0 \ub9de\ub2e4 \uad00\ub9ac \uc2dc\uc791 \ud608\uad00 \uc591\uc81c \uad6c\ub9e4 \ud608\uad00 \uc591\uc81c \uace0\ub974\ub2e4 \uc81c\ud488 \uae30\uc5b5 \uac1c\uc120 \uc815\ub9e5 \uc21c\ud658 \ucd08\uc810 \ub9de\ucd94\ub2e4 \uc368\ub2e4 \uc2dc\uc548 \ud608\uad00 \uac74\uac15 \ucd08\uc810 \ub9de\ucd94\ub2e4 \ucf5c\ub808\uc2a4\ud14c\ub864 \ud608\ud589 \uad00\ub9ac \uc911\uc810 \uad00\ub9ac \ud574\uc8fc\ub2e4 \uad6c\ub9e4 \uc624\uba54\uac00 \ub3d9\ubb3c\uc131 \uc544\ub2c8\ub2e4 \ud574\uc870\ub958 \ub9cc\ub4e4\ub2e4 \uc2dd\ubb3c\uc131 \uac74\uac15 \uc81c\ud488 \ud655\uc2e4\ud558\ub2e4 \ub2e4\ub974\ub2e4 \ub290\uaef4\uc9c0\ub2e4 \ucc28\uc11c \ub450\uaecd\ub2e4 \uc591\ub9d0 \uc2e0\ub2e4 \ud608\uc561 \uc21c\ud658 \ub3fc\ub2e4 \uadf8\ub807\ub2e4 \ub365\ub2e4 \uc591\ub9d0 \ubc97\ub2e4 \ubc84\ub9ac\ub2e4 \uc313\uc774\ub2e4 \ucf5c\ub808\uc2a4\ud14c\ub864 \ud608\uc804 \uc21c\ud658 \uc88b\ub2e4 \uc81c\ud488 \uac10\uc0ac\ud558\ub2e4 \ub2eb\ub2e4 \uc0c1\uc138 \uc0c1\uc138 \uc0c1\uc138 \uc0c1\uc138", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uc624\uba54\uac00 \ud64d\uad6d \ucf54\ud050\ud150 \uc88b\ub2e4 \ud655\uc2e4\ud558\ub2e4 \uc624\uba54\uac00 \uc88b\ub2e4 \ud3b8\ud558\ub2e4 \uc88b\ub2e4 \uad6c\ub9e4 \uc9dc\ub2e4 \uad6c\uc131 \uc800\ub834\ud558\ub2e4 \ub2e8\uac00 \uac10\uc0ac\ud558\ub2e4 \ub2eb\ub2e4 \uc0c1\uc138 \uc0c1\uc138 \uc0c1\uc138", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uace0\ud608\uc555 \uac00\uc871 \ud608\uad00 \uac74\uac15 \uac71\uc815 \ub3fc\ub2e4 \ud608\uad00 \uc88b\ub2e4 \uc624\uba54\uac00 \uc54c\uc544\ubcf4\ub2e4 \uc0dd\uc120 \ub9cc\ub4e4\ub2e4 \ub3d9\ubb3c\uc131 \uc624\uba54\uac00 \ub298\ub2e4 \uc911\uae08\uc18d \uc704\ud5d8 \ud574\uc870\ub958 \uc624\uba54\uac00 \uad6c\ub9e4 \uc784\uc0b0\ubd80 \uc18c\ub9ac \ubbff\ub2e4 \uad6c\ub9e4 \uc624\uba54\uac00 \ub298\ub2e4 \ud608\uad00 \uc911\uc131 \uc9c0\ubc29 \ub179\uc774\ub2e4 \ud608\uad00 \uccad\uc18c \ud574\uc8fc\ub2e4 \ud608\uc561 \uc21c\ud658 \ub3c4\uc640\uc8fc\ub2e4 \ubd88\uaddc\uce59\ud558\ub2e4 \uc2b5\uad00 \uc911\uc131 \uc9c0\ubc29 \uac71\uc815 \ud544\uc694\ud558\ub2e4 \uc591\uc81c \ub365\ub2e4 \ucf54\uc5d4\uc790\uc784 \ud050\ud150 \ud765\uad6d \ucf54\uc5d4\uc790\uc784 \ud050\ud150 \ubcc4\uba85 \uc2ec\uc7a5 \ube44\ud0c0\ubbfc \uc2ec\uc7a5 \ud38c\ud54c \ub3c4\uc640\uc8fc\ub2e4 \ud608\uc561 \uc21c\ud658 \uc88b\ub2e4 \ub3c4\uc640\uc8fc\ub2e4 \ub300\uc694 \ud765\uad6d \uc88b\ub2e4 \ucf5c\ub808\uc2a4\ud2b8\ub864 \ub192\uc774\ub2e4 \ub098\uc058\ub2e4 \ucf5c\ub808\uc2a4\ud14c\ub864 \ub0ae\ucd94\ub2e4 \ud608\uad00 \ub354\uc6b1 \uad00\ub9ac \uc88b\ub2e4 \uc591\uc81c \uba39\uae30 \uac00\uaca9 \ubd80\ub2f4 \uac2f\uc218 \ub9ce\uc544\uc9c0\ub2e4 \uba39\uae30 \uc26c\ub2e4 \uc368\ub2e4 \uc2dc\uc548 \ubaa8\ub4e0 \uc88b\ub2e4 \ub2e4\uac00 \uba74\uc5ed \uc88b\ub2e4 \ud608\uad00 \uc810\ub9c9 \uc88b\ub2e4 \uc62c\uc778\uc6d0 \ud608\uad00 \uad00\ub9ac\uc81c \ub044\ub2e4 \ub2eb\ub2e4 \uc0c1\uc138 \uc0c1\uc138 \uc0c1\uc138", "\uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4", "\ubbff\ub2e4 \uc0c1\uc138", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uc88b\ub2e4 \uad6c\ub9e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uc0c1\uc138", "\uac00\uaca9 \uc2f8\ub2e4 \uc0ac\ub2e4 \ubc30\uc1a1 \ube68\ub974\ub2e4", "\ud06c\ub9b4 \uc624\uc77c \uc624\uba54\uac00 \ub808\uc2dc\ud2f4 \ub0ab\ub2e4 \uad6c\ub9e4 \uac70\ubd80 \uc2dd\uac10 \uba39\uae30 \uadf8\ub807\ub2e4 \ubb3c\uc774 \uafc0\ub5a1 \uafc0\ub5a1 \uc0bc\ud0a4\ub2e4 \uad1c\ucc2e\ub2e4 \uc2a4\ud47c \ub3d9\ubd09 \uc54c\ub2e4 \uc544\uc27d\ub2e4 \uc0c1\uc138", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uc81c\ud488 \ub5a8\uc5b4\uc9c0\ub2e4 \uad6c\uc785 \uac31\ub144\uae30 \uc5ec\uc131 \ud544\uc694\ud558\ub2e4 \uc81c\ud488 \uc0c1\uc138", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ubc30\uc1a1 \ub4dc\ub9ac\ub2e4 \uc0ac\ub2e4 \uc88b\ub2e4 \ubd09\ud22c \uc8fc\uc2dc \uc12c\uc138\ud558\ub2e4 \uc0c1\uc138", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ubcfc\ub835", "\uc131\ub2a5 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \ub9db\uc788\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uc88b\ub2e4 \ub530\ub2e4 \ud655\uc2e4\ud558\ub2e4 \ube44\uad50 \ub9d0\ub85c \uc124\uba85", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ubee3\ubee3\ud558\ub2e4 \ubee3\ubee3\ud558\ub2e4 \ud604\uc0c1 \uc0ac\ub77c\uc9c0\ub2e4 \uc77c\uc5b4\ub098\uc9c0 \uc7a0\ub3c4 \uc88b\ub2e4 \uc7ac\ub2e4 \uc0c1\uc138", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \ud56d\uc0c1 \uc8fc\ubb38 \uc0c1\ud488 \uac31\ub144\uae30 \ubcf4\uc2dc \ud6c4\ud68c", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ubcf5\uc6a9 \uc790\uc138 \ud55c\uae00 \ub0a8\uae30\ub2e4 \uc88b\ub2e4", "\ubc30\uc1a1 \uc131\ub2a5 \uc720\ud1b5 \uae30\ud55c \uac74\uc9c0\ub2e4 \uac74\uc9c0\ub2e4 \uc808\ubc18 \ubaa8\ub974\ub2e4", "\uce58\ub9e4 \uc608\ubc29 \ub3c4\uc6c0 \uc81c\ud488 \ub9cc\uc871\ud558\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ub9c9\ub2e4 \uc57c\ud558\ub2e4 \uad6c\ub9e4 \ud574\ubd24\ub2e4 \uba40\ub2e4 \uc88b\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uc131\ub2a5 \ubaa8\ub974\ub2e4", "\uac00\uaca9 \uad1c\ucc2e\ub2e4 \ubc30\uc1a1 \uad1c\ucc2e\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uc2e0\ub791 \ucf5c\ub808\uc2a4\ud14c\ub864 \ub192\ub2e4 \uc7ac\ub2e4 \uafb8\uc900\ud558\ub2e4 \uba39\uc774\ub2e4 \uc0c1\uc138", "\uac00\uaca9 \uad1c\ucc2e\ub2e4 \ubc30\uc1a1 \uc88b\ub2e4", "\uac00\uaca9 \uad1c\ucc2e\ub2e4 \ubc30\uc1a1", "\ubc30\uc1a1 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4", "\uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ud3ec\uc7a5 \uc0c1\ud0dc \ud3ec\uc7a5 \uae54\ub054\ud558\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ub9d1\ub2e4 \uae30\ubd84 \uc88b\ub2e4 \uae30\ub300\ud558\ub2e4 \uc0c1\uc138", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uc911\uc131 \uc9c0\uc9c8 \ucf5c\ub808\uc2a4\ud14c\ub864 \ub192\ub2e4 \uc2ec\ud558\ub2e4 \uac74\uac15\uac80\uc9c4 \uc8fc\uc758 \ud558\ub798 \uac31\ub144\uae30 \uc624\ub2c8 \ud608\uad00 \uc9c8\ud658 \uc0dd\uae30 \ud608\uc555 \uc815\uc0c1 \uac80\uc9c4 \uacbd\uacc4 \ud608\uc555 \uae5c\ub180 \ub808\uc2a4 \ud2b8\ub864 \uc218\uce58 \ub192\ub2e4 \ub180\ub798\ub2e4 \uc0ac\uc774 \uac31\ub144\uae30 \uc811\ub2e4 \ub298\ub2e4 \ub3c4\ud574 \uc758\uc0ac \uac31\ub144\uae30 \uadf8\ub807\ub2e4 \ud608\uad00 \uc9c8\ud658 \ubc1c\uc0dd \uc6b4\ub3d9 \ud558\ub77c \uc6b4\ub3d9 \uc548\ud574 \uc815\uc0c1 \uc815\ub9d0 \ub180\ub798\ub2e4 \uc6b4\ub3d9 \uac74\uac15 \ubcf4\uc870 \uc2dd\ud488 \ub178\ub9ac\ub2e4 \ub098\uc774 \uc11c\ub7fd\ub2e4 \uc624\uc2ed \ubaa8\ub85c \ud798\ub4dc\ub2e4 \uc0c1\uc138", "\uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ud3ec\uc7a5 \uc0c1\ud0dc \ud3ec\uc7a5 \uae54\ub054\ud558\ub2e4 \uc88b\ub2e4 \uc81c\ud488 \ub6f0\uc5b4\ub098\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uc774\uc8fc \uc9c0\ub098\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uafb8\uc900\ud558\ub2e4 \ubcf5\uc6a9 \ud608\uc555 \uc548\uc815 \ub0ae\uc544\uc9c0\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc720\ud1b5 \uae30\ud55c \ubaa8\ub974\ub2e4 \uafb8\uc900\ud558\ub2e4 1\ub144 \ud608\uad00 \uad00\ub9ac \ub93c\ud574", "\uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ud3ec\uc7a5 \uc0c1\ud0dc \ud3ec\uc7a5 \uae54\ub054\ud558\ub2e4 \uc88b\ub2e4 \ubc8c\uc368 \ub450\ubc88\uc9f8 \uad6c\uc785 \uac00\uc871 \ubcf5\uc6a9 \ub6f0\uc5b4\ub098\ub2e4 \ub290\ub07c\ub2e4 \ubbff\ub2e4 \ub2f9\ubd84\uac04 \uafb8\uc900\ud558\ub2e4 \ubcf5\uc6a9 \uc54c\uc57d \uc0bc\ud0a4\ub2e4 \ud3b8\ud558\ub2e4 \ubd80\ub4dc\ub7fd\ub2e4 \ud544\uc694\ud558\ub2e4 \uc131\ubd84 \uc88b\ub2e4 \uc0c1\uc138 \uc0c1\uc138", "\uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ud3ec\uc7a5 \uc0c1\ud0dc \ud3ec\uc7a5 \uae54\ub054\ud558\ub2e4 \ud3ec\uc7a5 \ubc29\ubc95 \uc124\uba85 \ud6c4\uae30 \uc88b\ub2e4 \ub298\ub2e4 \uc8fc\ubb38 \ubcf5\uc6a9 \ud574\ubcf4\ub2e4 \ub9ac\ubdf0 \uc218\uc815 \uc0c1\uc138", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uc544\ub4e4 \uc190\ubc1c \ucc28\uac11\ub2e4 \ub2e4\ud574 \uc368\ub2e4 \uc548\uc774 \uc88b\uc544\ud558\ub2e4 \uc0bf\uc5b4 \uc88b\ub2e4 \uc88b\ub2e4 \uc0c1\uc138", "\ubc30\uc1a1 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uc88b\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4", "\uac00\uaca9 \uad1c\ucc2e\ub2e4 \ubc30\uc1a1", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc720\ud1b5 \uae30\ud55c \uc81c\ud488 \uc54c\uc57d \uc0ac\uc774\uc988 \ucee4\uc11c \uba39\uae30 \ubd88\ud3b8\ud558\ub2e4 \uc81c\ud488 \uc801\ub2f9\ud558\ub2e4 \ub118\ub2e4 \uad1c\ucc2e\ub2e4 \uc0c1\uc138", "\ud608\uad00 \uac74\uac15 \uc2a4\ud2b8\ub808\uc2a4 \uc644\ud654 \uc0ac\ub2e4", "\ubc30\uc1a1 \uc88b\ub2e4 \ud558\ub2c8 \uad1c\ucc2e\ub2e4 \ub2e4\uc2dc \uc8fc\ubb38 \ud3ec\uc7a5 \uc0c1\ud0dc \uc88b\ub2e4", "\ubc30\uc1a1 \ 2e0\ub791 \ucf5c\ub808\uc2a4\ud14c\ub864 \uc218\uce58 \ub192\uc544\uc9c0\ub2e4 \ud608\uc561 \uc21c\ud658 \uc548\ub418\ub2e4 \uc0ac\uba39\ub2e4 2\ub144 \uac00\uae4c\uc774 \ube44\uc2f8\ub2e4 35000 \uc9dc\ub2e4 \uac10\ub9c8 \ub9ac\ub180\ub80c\uc0b0 \uc218\uce58 \uc0c1\ud488 \ub0ae\ub2e4 \uc2e0\ub791 \uc598\ub8e8 \uba39\uc774\ub2e4 \ube44\uc2f8\ub2e4 \uc0ac\ub2e4 \ube44\uc2f8\ub2e4 \ube7c\ub2e4 \uc0c1\uc138", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ube60\ub974\ub2e4 \ubc30\uc1a1", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uc0ac\ub77c \uc0ac\ub2e4 \ud6c4\uae30 \uc368\ub2e4", "\uac00\uaca9 \uc2f8\ub2e4 \uc0ac\ub2e4 \ubc30\uc1a1 \ube68\ub974\ub2e4 \ud53c\ubd80 \uac00\ub824\uc6c0 \uc5c6\uc5b4\uc9c0\ub2e4 \ub3c4\uc6c0 \ub41c\uac70", "\ud14c\uadf8 \uc0c1\ud488 \uad6c\ub9e4 \uc804\ud600 \uc548\ub098 \ucea1\uc290 \ud06c\ub2e4 \ud30c\ub2e4", "\ub0a8\ud3b8 \ud6a8\ub2a5 \ubaa8\ub974\ub2e4 \uafb8\uc900\ud558\ub2e4 \uc0c1\uc138 \uc0c1\uc138", "\uac00\uaca9 \uad1c\ucc2e\ub2e4 \ubc30\uc1a1 \ube68\ub974\ub2e4 \ub2ec\ub77c\uc9c0\ub2e4 \uafb8\uc900\ud558\ub2e4 \ub9cc\uc871\ud558\ub2e4", "\uac00\uaca9 \uad1c\ucc2e\ub2e4 \ubc30\uc1a1 \ube68\ub974\ub2e4 \uc88b\ub2e4 \uc0c1\ud488 \ube60\ub974\ub2e4 \ubc30\uc1a1 \uc0c1\ud488 \ub9c8\uc74c \uc801\uadf9 \ucd94\ucc9c \ud30c\ub2e4", "\ubc30\uc1a1 \uc131\ub2a5 \uc720\ud1b5 \uae30\ud55c \uafb8\uc900\ud558\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uc88b\ub2e4 \uac00\uaca9 \uc798\uc0b4\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uc5ec\uc131 \uc88b\uc544\ud558\ub2e4", "\uace0\ubb34\uc904 \uc539\ub2e4 \uace0\ud1b5 \ubc30\uc1a1 \ube60\ub974\ub2e4 \uae54\ub054\ud558\ub2e4", "\uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ud3ec\uc7a5 \uc0c1\ud0dc \ud3ec\uc7a5 \uae54\ub054\ud558\ub2e4 \uc88b\ub2e4", "\uac00\uaca9 \uad1c\ucc2e\ub2e4 \ubc30\uc1a1 \ube68\ub974\ub2e4", "\ubc30\uc1a1 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4", "\uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ud3ec\uc7a5 \uc0c1\ud0dc \ud3ec\uc7a5 \uae54\ub054\ud558\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 1\ub144 \ub118\ub2e4 \uace0\ud608\uc555 \uba39\uae30 \ub450\ud1b5 \uc790\uc8fc \uc0ac\ub77c\uc9c0\ub2e4 \uafb8\uc900\ud558\ub2e4 \uad6c\ub9e4", "\ubc30\uc1a1 \uc720\ud1b5 \uae30\ud55c", "\ubc30\uc1a1 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uace0\ud608\uc555 \uba39\uae30 \ub2e8\uacc4 \uc2ec\uc0ac\uc219\uace0 \ubcf5\uc6a9 \ubcf5\uc6a9 \ubcc0\ud654 \ub290\ub07c\ub2e4 \uafb8\uc900\ud558\ub2e4", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uc138\ubc88 \uad6c\ub9e4 \uc9c0\uc18d \ubcf5\uc6a9 \uc0c1\uc138", "\uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \ud3ec\uc7a5 \uc0c1\ud0dc \ud3ec\uc7a5 \uae54\ub054\ud558\ub2e4 \uc88b\ub2e4 \ud608\uc555 \uafb8\uc900\ud558\ub2e4 \ubcf5\uc6a9 \ubaa8\ub974\ub2e4 \ubd88\uc548\ud558\ub2e4 \ubcf5\uc6a9", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \ub109\ub109\ud558\ub2e4 \uace0\uc9c0\ud608\uc99d \uad6c\uc785 \ubcf5\uc6a9", "\ubc30\uc1a1 \ube68\ub974\ub2e4 \uc131\ub2a5 \uc131\ub2a5 \ub6f0\uc5b4\ub098\ub2e4 \uc720\ud1b5 \uae30\ud55c \uae30\ud55c \
